                    cn: "\u0422\u0430\u043b\u043e\u043d \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f - \u044d\u0442\u043e QR-\u043a\u043e\u0434, \u0441\u043e\u0434\u0435\u0440\u0436\u0430\u0449\u0438\u0439 \u0432\u0430\u0448\u0438 \u0432\u044b\u0431\u043e\u0440\u044b. \u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043f\u0435\u0440\u0435\u043d\u0435\u0441\u0442\u0438 \u0441\u0432\u043e\u0439 \u0432\u044b\u0431\u043e\u0440 \u0441 \u0432\u0430\u0448\u0435\u0433\u043e \u0442\u0430\u043b\u043e\u043d\u0430 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u043d\u0430 \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u043e \u0434\u043b\u044f \u043c\u0430\u0440\u043a\u0438\u0440\u043e\u0432\u043a\u0438 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u0435\u0439 \u0432 \u043b\u044e\u0431\u043e\u043c \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f.",
                    co: "\u0425\u0440\u0430\u043d\u0438\u0442\u0441\u044f \u043b\u0438 \u043c\u043e\u044f \u043b\u0438\u0447\u043d\u0430\u044f \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u0432 \u0442\u0430\u043b\u043e\u043d\u0435 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f?",
                    cp: "\u041d\u0435\u0442.  \u0422\u0430\u043b\u043e\u043d \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u0435\u0442 \u0432\u0430\u0448 \u0442\u0438\u043f \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f \u0438 \u0432\u044b\u0431\u043e\u0440.  \u041d\u0438\u043a\u0430\u043a\u0430\u044f \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u043e \u0432\u0430\u0441 \u043d\u0435 \u0445\u0440\u0430\u043d\u0438\u0442\u0441\u044f.",
                    cq: "\u042f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u043b\u0438 \u043c\u043e\u0438 \u0432\u044b\u0431\u043e\u0440\u044b \u043a\u043e\u043d\u0444\u0438\u0434\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u044b\u043c\u0438?",
                    cr: "\u0414\u0430.  \u0412\u0430\u0448\u0438 \u0432\u044b\u0431\u043e\u0440\u044b \u0441\u043e\u0445\u0440\u0430\u043d\u044f\u044e\u0442\u0441\u044f \u0442\u043e\u043b\u044c\u043a\u043e \u0432 \u0432\u0430\u0448\u0435\u043c \u0442\u0430\u043b\u043e\u043d\u0435 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u0438\u043b\u0438 \u043d\u0430 \u0432\u0430\u0448\u0435\u043c \u043b\u0438\u0447\u043d\u043e\u043c \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0435.",
                    cs: "\u0414\u043e\u043b\u0436\u0435\u043d \u043b\u0438 \u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u0442\u044c \u0438\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044c\u043d\u043e\u0433\u043e \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f \u0438 \u0442\u0430\u043b\u043e\u043d \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f?",
                    ct: "\u041d\u0435\u0442.  \u0418\u043d\u0442\u0435\u0440\u0430\u043a\u0442\u0438\u0432\u043d\u044b\u0439 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f \u0438 \u0442\u0430\u043b\u043e\u043d \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u0434\u043e\u043f\u043e\u043b\u043d\u0438\u0442\u0435\u043b\u044c\u043d\u044b\u043c\u0438 \u0438\u043d\u0441\u0442\u0440\u0443\u043c\u0435\u043d\u0442\u0430\u043c\u0438 \u0434\u043b\u044f \u0443\u0441\u043a\u043e\u0440\u0435\u043d\u0438\u044f \u0432\u0430\u0448\u0435\u0433\u043e \u0441\u043f\u043e\u0441\u043e\u0431\u0430 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f.",
                    cu: "\u0413\u0434\u0435 \u044f \u043c\u043e\u0433\u0443 \u043d\u0430\u0439\u0442\u0438 \u0446\u0435\u043d\u0442\u0440 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f?",
                    cv: "\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043d\u0430\u0439\u0442\u0438 \u0446\u0435\u043d\u0442\u0440 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f, \u043f\u043e\u0441\u0435\u0442\u0438\u0432 locator.lavote.net/locations/vc \u0438\u043b\u0438 \u043d\u0430\u0436\u0430\u0432 \u0437\u0434\u0435\u0441\u044c.",
                    cw: "\u0412\u0435\u0440\u043d\u0443\u0442\u044c\u0441\u044f \u043a \u043d\u0430\u0447\u0430\u043b\u0443",
                    cx: "\u0414\u043e\u0441\u0442\u0443\u043f \u043a \u0432\u0430\u0448\u0435\u043c\u0443 \u043e\u0431\u0440\u0430\u0437\u0446\u0443 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f",
                    cy: "\u0412\u0430\u0448\u0430 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u043e\u043d\u043d\u0430\u044f \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044f \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u0435\u0442\u0441\u044f, \u0447\u0442\u043e\u0431\u044b \u043d\u0430\u0439\u0442\u0438 \u0432\u0430\u0448 \u043e\u0431\u0440\u0430\u0437\u0435\u0446 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f.",
                    cz: "\u042d\u0442\u0430 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044f \u043d\u0435 \u043f\u0440\u0438\u0432\u044f\u0437\u0430\u043d\u0430 \u043a \u0432\u0430\u0448\u0438\u043c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u043c \u0432\u0430\u0440\u0438\u0430\u043d\u0442\u0430\u043c.",
                    da: "\u0424\u0430\u043c\u0438\u043b\u0438\u044f",
                    db: "\u0414\u0430\u0442\u0430 \u0440\u043e\u0436\u0434\u0435\u043d\u0438\u044f",
                    dc: "\u041c\u0435\u0441\u044f\u0446",
                    dd: "\u0414\u0435\u043d\u044c",
                    de: "\u0413\u043e\u0434",
                    df: "\u0412\u0430\u0448 \u043d\u043e\u043c\u0435\u0440 \u0434\u043e\u043c\u0430",
                    dg: "\u0412\u0432\u0435\u0434\u0438\u0442\u0435 \u043d\u043e\u043c\u0435\u0440 \u0434\u043e\u043c\u0430 \u0434\u043b\u044f \u0430\u0434\u0440\u0435\u0441\u0430, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u0432\u044b \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043b\u0438 \u043f\u0440\u0438 \u0440\u0435\u0433\u0438\u0441\u0442\u0440\u0430\u0446\u0438\u0438 \u0434\u043b\u044f \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f.",
                    dh: "\u041f\u0440\u0438\u043c\u0435\u0440: \u0434\u043b\u044f \u0430\u0434\u0440\u0435\u0441\u0430 123 Main St, Apt 2B, \u0432\u0430\u0448 \u043d\u043e\u043c\u0435\u0440 \u0434\u043e\u043c\u0430 123",
                    di: "\u041f\u0440\u0435\u0434\u043f\u043e\u0447\u0438\u0442\u0430\u0435\u0442\u0435 \u043d\u0435 \u043f\u0440\u0435\u0434\u043e\u0441\u0442\u0430\u0432\u043b\u044f\u0442\u044c \u044d\u0442\u0443 \u0438\u043d\u0444\u043e\u0440\u043c\u0430\u0446\u0438\u044e?",
                    dj: "\u041f\u043e\u043f\u0440\u043e\u0431\u0443\u0439\u0442\u0435 \u043f\u043e\u0438\u0441\u043a \u0430\u0434\u0440\u0435\u0441\u0430",
                    dk: "\u041d\u0430\u0439\u0442\u0438 \u043c\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c",
