                    ga: "\u0917\u0948\u0930-\u0938\u0942\u091a\u0940\u092c\u0927\u094d\u0926",
                    gb: "\u092e\u0924\u0926\u093e\u0928 \u0915\u0947\u0902\u0926\u094d\u0930 \u092e\u0947\u0902 \u0917\u0948\u0930-\u0938\u0942\u091a\u0940\u092c\u0927\u094d\u0926 \u091a\u092f\u0928 \u0932\u093f\u0916\u0947\u0902\u0964",
                    gc: "\u0906\u0927\u093f\u0915\u093e\u0930\u093f\u0915 \u0935\u093f\u0936\u094d\u0932\u0947\u0937\u0923",
                    gd: "\u0905\u0927\u093f\u0915",
                    ge: "\u092e\u0924\u092a\u0924\u094d\u0930 \u0915\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u093e \u092a\u0941\u0928\u0930\u0940\u0915\u094d\u0937\u0923 \u0915\u0930\u0947\u0902",
                    gf: "\u0935\u093e\u092a\u0938 \u091c\u093e\u090f\u0902",
                    gg: "\u092e\u0941\u0926\u094d\u0926\u093e",
