                    gk: "\u092c\u0902\u0926 \u0915\u0930\u0947\u0902",
                    gl: "\u0905\u092a\u0928\u0947 \u0928\u092e\u0942\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u0915\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u093e \u092a\u0941\u0928\u0930\u0940\u0915\u094d\u0937\u0923 \u0915\u0930\u0947\u0902",
                    gm: "\u0906\u092a \u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0915\u0947 \u0915\u093f\u0938\u0940 \u092d\u0940 \u091a\u092f\u0928 \u0915\u094b \u0938\u0902\u0936\u094b\u0927\u093f\u0924 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964",
                    gn: "\u091c\u092c \u0906\u092a \u0905\u092a\u0928\u093e \u0928\u092e\u0942\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u091a\u093f\u0939\u094d\u0928\u093f\u0924 \u0915\u0930\u0928\u093e \u0938\u092e\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u0947\u0902, \u0924\u094b \u091a\u092f\u0928\u094b\u0902 \u0915\u0940 \u092a\u0941\u0937\u094d\u091f\u093f \u0915\u0930\u0947\u0902 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902",
                    go: "1 \u091a\u092f\u0928 \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u0948",
                    gp: "# \u091a\u092f\u0928\u094b\u0902 \u0909\u092a\u0932\u092c\u094d\u0927 \u0939\u0948",
                    gq: "\u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928",
                    gr: "\u0938\u0942\u091a\u0940 \u0915\u093e \u0905\u0902\u0924",
                    gs: "\u091a\u092f\u0928 \u092e\u093f\u091f\u093e\u090f\u0902",
                    gt: "\u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u092c\u093e\u0926 \u0915\u0947 \u0932\u093f\u090f \u092c\u091a\u093e \u0915\u0947 \u0930\u0916\u0947\u0902",
                    gu: "\u092a\u0942\u0930\u0947 \u0915\u093f\u092f\u0947 \u0917\u092f\u0947 \u092e\u0941\u0926\u094d\u0926\u0947\u0902",
                    gv: "\u091a\u092f\u0928\u094b\u0902 \u0915\u0940 \u092a\u0941\u0937\u094d\u091f\u0940 \u0915\u0930\u0947\u0902",
                    gw: "\u0938\u092b\u0932\u0924\u093e",
                    gx: "\u0906\u092a\u0928\u0947 \u0905\u092a\u0928\u0947 \u0909\u092a\u0915\u0930\u0923 \u0915\u0947 \u0917\u094b\u092a\u0928\u0940\u092f\u0924\u093e \u0935\u093f\u0928\u094d\u092f\u0938\u094b\u0902 \u0915\u094b \u0938\u093e\u0930\u094d\u0935\u091c\u0928\u093f\u0915 \u0938\u0947 \u0928\u093f\u091c\u0940 \u092e\u0947\u0902 \u0938\u0902\u0936\u094b\u0927\u093f\u0924 \u0915\u093f\u092f\u093e \u0939\u0948\u0902",
                    gy: "\u092c\u0902\u0926 \u0915\u0930\u0947\u0902",
                    gz: "\u0905\u092a\u0928\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u0938\u0939\u0947\u091c\u0947",
                    ha: "\u0905\u092a\u0928\u0947 \u091a\u092f\u0928 \u0915\u094b \u0938\u0939\u0947\u091c\u0928\u0947 \u0938\u0947 \u0906\u092a\u0915\u0947 \u0917\u0941\u092a\u094d\u0924 \u091a\u092f\u0928 \u0938\u093e\u0930\u094d\u0935\u091c\u0928\u093f\u0915 \u0938\u0947 \u0928\u093f\u091c\u0940 \u092e\u0947\u0902 \u0938\u0902\u0936\u094b\u0927\u093f\u0924 \u0939\u094b \u091c\u093e\u090f\u0901\u0917\u0947\u0964",
                    hb: "\u0905\u092a\u0928\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u0938\u0939\u0947\u091c\u0928\u093e \u091c\u093e\u0930\u0940 \u0930\u0916\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0928\u0940\u091a\u0947 \u0926\u093f\u090f \u0917\u090f \u091a\u092f\u0928 \u0938\u0939\u0947\u091c\u0947\u0902 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902\u0964",
                    hc: "\u0930\u0926\u094d\u0926 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0916\u093f\u0921\u0915\u0940 \u092c\u0902\u0926 \u0915\u0930\u0947\u0902",
                    hd: "\u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u0938\u0939\u0947\u091c\u0947",
                    he: "\u0905\u092a\u0928\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u092e\u093f\u091f\u093e\u090f\u0902",
                    hf: "\u092f\u0926\u093f \u0906\u092a \u0905\u092a\u0928\u0947 \u0928\u092e\u0942\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u0915\u0947 \u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u092e\u093f\u091f\u093e\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0928\u0940\u091a\u0947 \u0926\u093f\u092f\u0947 \u0917\u090f \u091a\u092f\u0928\u094b\u0902 \u0915\u094b \u092e\u093f\u091f\u093e\u090f\u0902 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902\u0964",
                    hg: "\u0930\u0926\u094d\u0926 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0916\u093f\u0921\u0915\u0940 \u092c\u0902\u0926 \u0915\u0930\u0947\u0902",
                    hh: "\u091a\u092f\u0928 \u092e\u093f\u091f\u093e\u090f\u0902",
                    hi: "\u092c\u0927\u093e\u0908 \u0939\u094b, \u0906\u092a\u0928\u0947 \u0905\u092a\u0928\u093e \u0928\u092e\u0942\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u091a\u093f\u0939\u094d\u0928\u093f\u0924 \u0915\u0930\u0928\u093e \u0938\u092e\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u093f\u092f\u093e \u0939\u0948\u0902",
                    hj: "\u0905\u092a\u0928\u093e \u092e\u0924\u0926\u093e\u0928 \u092a\u093e\u0938 \u092c\u0928\u093e\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, \u0928\u0940\u091a\u0947 \u0926\u093f\u092f\u0947 \u0917\u092f\u0947 \u092e\u0924\u0926\u093e\u0928 \u092a\u093e\u0938 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0947\u0902 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902\u0964",
                    hk: "\u0905\u092a\u0928\u0947 \u0928\u092e\u0942\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u092a\u0930 \u0905\u0902\u0915\u093f\u0924 \u0915\u0930\u0947\u0902",
                    hl: "\u0911\u0928\u0932\u093e\u0907\u0928 \u092a\u0930 \u092a\u0942\u0930\u093e \u0915\u093f\u092f\u093e \u0939\u0941\u0906",
                    hm: "\u092e\u0924\u0926\u093e\u0928 \u092a\u093e\u0938 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0915\u0930\u0947\u0902",
                    hn: "\u0911\u0928\u0932\u093e\u0907\u0928",
