                    hp: "\u0905\u092a\u0928\u0947 \u092e\u0924\u0926\u093e\u0928 \u092a\u093e\u0938 \u0915\u094b \u0915\u093f\u0938\u0940 \u092d\u0940 \u092e\u0924\u0926\u093e\u0928 \u0915\u0947\u0902\u0926\u094d\u0930 \u092a\u0930 \u0932\u0947 \u0906\u090f\u0902",
