                    lb: "Bakit walang resulta ang mahanap matapos kung ilagay ang aking impormasyon at/o direksyon ng tirahan?",
                    lc: "Maaaring hindi ka nakarehistro para bumoto sa County ng Los Angeles, o ang impormasyon na iyong inilagay ay hindi katugma ng iyong kasalukuyang rehistrasyon ng pagboto. Sa karagdagan, kung ang inilagay mong direksyon ng tirahan ay nasa labas ng County ng Los Angeles, walang resulta ang mahahanap. Kung sa iyong palagay ito ay mali, mangyaring makipag-ugnayan sa amin sa voterinfo@rrcc.lacounty.gov\xa0o sa 1-800-815-2666 opsyon 2. <a href='https://www.lavote.net/home/voting-elections/voter-education/what-to-do-before-an-election/register-to-vote' target='_blank'>Kung ikaw ay hindi nakarehistro upang bumoto, maaari kang magrehistro dito.</a>",
                    ld: "Ang aking impormasyon ba ay itatala, iimbakin o gagawing dokumentado?",
