                    lx: 'I-klik o tapikin ang "Bumalik" o "Kasunod" na pindutan sa ibaba ng bawat labanan. Para sa mga kagamitang desktop o laptop mayroong isang kagamitang navigator ang balota na tinatawag na "Aking Balota" na matatagpuan sa kaliwa. Mag-scroll sa "Aking Balota," upang lumaktaw na deretso sa isang labanan sa pamamagitan ng pag-klik at pagtapik sa titulo nito. Para sa mga mobile at nahahawakang mga kagamitan, maaaring lumaktaw sa isang partikular na labanan o tapikin ang "Suriin" (matatagpuan sa pamagat). Pagkatapos, mag-scroll sa labanan na gusto mong botohan at tapikin ang "Baguhin" na pindutan upang magtungo ng deretso sa labanang iyon.',
