                    lc: "\u60a8\u53ef\u80fd\u6c92\u6709\u5728Los Angeles\u7e23\u9032\u884c\u6295\u7968\u767b\u8a18\uff0c\u6216\u8005\u8f38\u5165\u7684\u4fe1\u606f\u8207\u76ee\u524d\u7684\u9078\u6c11\u767b\u8a18\u4e0d\u7b26\u3002\u6b64\u5916\uff0c\u5982\u679c\u60a8\u8f38\u5165\u7684\u662fLos Angeles\u7e23\u4ee5\u5916\u7684\u5730\u5740\uff0c\u5247\u4e0d\u6703\u627e\u5230\u4efb\u4f55\u7d50\u679c\u3002\u5982\u679c\u60a8\u8a8d\u70ba\u9019\u662f\u932f\u8aa4\u7684\uff0c\u8acb\u900f\u904eVoterinfo@rrcc.lacounty.gov\u62161-800-815-2666\u9078\u9805 3 \u8207\u6211\u5011\u806f\u7e6b\u3002 <a href='https://www.lavote.net/home/voting-elections/voter-education/what-to-do-before-an-election/register-to-vote' target='_blank'>\u5982\u679c\u60a8\u5c1a\u672a\u767b\u8a18\u6295\u7968\uff0c\u53ef\u4ee5\u5728\u9019\u88e1\u767b\u8a18\u6295\u7968\u3002</a>",
                    ld: "\u6211\u7684\u4fe1\u606f\u6703\u88ab\u8a18\u9304\uff0c\u5b58\u5132\u6216\u8a18\u9304\u55ce\uff1f",
                    le: "\u4e0d\u6703\u3002\u60a8\u7684\u4fe1\u606f\u548c/\u6216\u5730\u5740\u50c5\u7528\u65bc\u63d0\u4f9b\u6b63\u78ba\u7684\u9078\u7968\u3002",
                    lj: "\u6211\u7684\u9078\u64c7\u5b89\u5168\u55ce\uff1f",
                    lk: "\u662f\u7684\u3002\u60a8\u7684\u9078\u64c7\u50c5\u4fdd\u5b58\u5728\u6295\u7968\u901a\u884c\u8b49(Poll Pass)\u6216\u500b\u4eba\u8a2d\u5099\u4e2d\u3002",
                    ll: "\u6211\u7684\u9078\u64c7\u6703\u88ab\u7e23\u6536\u96c6\u55ce\uff1f",
                    lm: "\u4e0d\u6703\u3002\u60a8\u5728\u4e92\u52d5\u5f0f\u9078\u7968\u6a23\u672c\u4e2d\u7684\u9078\u64c7\u4e0d\u662f\u7531\u7e23\u6536\u96c6\u7684\u3002\u53ea\u6703\u6536\u96c6\u60a8\u5728\u6295\u7968\u4e2d\u5fc3\u7684\u9078\u7968\u4e0a\u6b63\u5f0f\u63d0\u4ea4\u7684\u9078\u9805\u3002",
                    ln: "\u5982\u679c\u95dc\u9589\u7db2\u7d61\u700f\u89bd\u5668\u6216\u700f\u89bd\u5668\u9078\u9805\uff0c\u6211\u7684\u9078\u64c7\u6703\u907a\u5931\u55ce\uff1f",
                    lo: "\u662f\u7684\u3002\u767b\u8a18\u6295\u7968\u3002\u5982\u679c\u60a8\u4f7f\u7528\u7684\u662f\u516c\u5171\u8a2d\u5099\uff0c\u5247\u5728\u96b1\u79c1\u63d0\u793a\u4e0a\u9078\u64c7\u201c\u9019\u662f\u516c\u5171\u8a2d\u5099\u201d\u3002\u6216\u8005\uff0c\u5982\u679c\u60a8\u6b63\u5728\u4f7f\u7528\u500b\u4eba\u8a2d\u5099\uff0c\u4e26\u5728\u96b1\u79c1\u63d0\u793a\u4e0a\u9078\u64c7\u201c\u9019\u662f\u79c1\u4eba\u8a2d\u5099\u201d\uff0c\u5247\u60a8\u7684\u9078\u64c7\u5c07\u88ab\u4fdd\u5b58\uff0c\u76f4\u5230\u6e05\u9664\u700f\u89bd\u5668\u7de9\u5b58\u70ba\u6b62\u3002",
                    lq: "\u958b\u59cb\u6a19\u8a18\u9078\u7968\u5f8c\u8981\u66f4\u6539\u96b1\u79c1\u8a2d\u7f6e\u600e\u9ebc\u8fa6\uff1f",
                    lr: "\u901a\u904e\u5c0e\u822a\u5230\u201c\u8a2d\u7f6e\u201d\u9078\u9805\u4e2d\u7684\u201c\u96b1\u79c1\u201d\u9078\u55ae\uff0c\u53ef\u4ee5\u96a8\u6642\u66f4\u6539\u96b1\u79c1\u8a2d\u7f6e\u3002\u60a8\u9084\u53ef\u4ee5\u901a\u904e\u9078\u64c7\u5e95\u90e8\u9801\u9762\u4e0a\u7684\u201c\u4ee5\u5f8c\u4fdd\u5b58\u9078\u64c7\u201d\u6309\u9215\u4f86\u5f9e\u201c\u67e5\u770b\u201d\u9801\u9762\u66f4\u6539\u6b64\u8a2d\u7f6e\u3002",
                    ls: "\u5982\u4f55\u6a19\u8a18\u6211\u7684\u9078\u64c7\uff1f",
                    lt: "\u5728\u5019\u9078\u4eba\u6216\u7af6\u9078\u9805\u76ee\u5468\u570d\u7684\u9577\u65b9\u5f62\u6846\u4e2d\u55ae\u64ca\u6216\u9ede\u6309\u4ee5\u9032\u884c\u9078\u64c7\u3002\u5982\u679c\u60a8\u4f7f\u7528\u7684\u662f\u8f14\u52a9\u8a2d\u5099\uff0c\u8acb\u5c0e\u822a\u81f3\u6240\u9700\u7684\u9078\u9805\uff0c\u4e26\u5728\u6a19\u51fa\u986f\u793a\u5f8c\u9032\u884c\u9078\u64c7\u3002",
                    lu: "\u6211\u5982\u4f55\u4e86\u89e3\u6709\u95dc\u5019\u9078\u4eba\u6216\u8b70\u6848/\u63d0\u6848\u7684\u66f4\u591a\u4fe1\u606f\uff1f",
                    lv: "\u9ede\u9078\u6216\u9ede\u64ca\u5019\u9078\u4eba\u6216\u8b70\u6848/\u63d0\u6848\u53f3\u5074\u7684\u201c\u4fe1\u606f\u201d\u5716\u6a19\u3002\u67e5\u770b\u5b8c\u5176\u4ed6\u4fe1\u606f\u5f8c\uff0c\u55ae\u64ca\u6216\u9ede\u9078\u201c\u95dc\u9589\u201d\u4ee5\u8fd4\u56de\u7af6\u9078\u9805\u76ee\u3002",
                    lw: "\u5982\u4f55\u700f\u89bd\u6211\u7684\u9078\u7968\uff1f",
                    lx: "\u55ae\u64ca\u6216\u9ede\u9078\u6bcf\u500b\u7af6\u9078\u9805\u76ee\u5e95\u90e8\u7684\u201c\u8fd4\u56de\u201d\u6216\u201c\u4e0b\u4e00\u6b65\u201d\u6309\u9215\u3002\u5c0d\u65bc\u684c\u4e0a\u578b\u6216\u7b46\u8a18\u578b\u96fb\u8166\u8a2d\u5099\uff0c\u5de6\u5074\u6709\u4e00\u500b\u540d\u70ba\u201c\u6211\u7684\u6295\u7968\u201d\u7684\u6295\u7968\u5c0e\u822a\u5668\u5de5\u5177\u3002\u6efe\u52d5\u700f\u89bd\u201c\u6211\u7684\u9078\u7968\u201d\uff0c\u4ee5\u901a\u904e\u55ae\u64ca\u6216\u9ede\u9078\u5176\u6a19\u984c\u76f4\u63a5\u8df3\u81f3\u7af6\u9078\u9805\u76ee\u3002\u5c0d\u65bc\u79fb\u52d5\u6216\u624b\u6301\u8a2d\u5099\uff0c\u60a8\u53ef\u4ee5\u901a\u904e\u55ae\u64ca\u6216\u9ede\u64ca\u201c\u67e5\u770b\u201d\uff08\u4f4d\u65bc\u6a19\u984c\u4e2d\uff09\u4f86\u8df3\u5230\u7279\u5b9a\u7af8\u9078\u9805\u76ee\u3002\u7136\u5f8c\uff0c\u6efe\u52d5\u81f3\u60a8\u8981\u6295\u7968\u7684\u7af8\u9078\u9805\u76ee\uff0c\u7136\u5f8c\u9ede\u64ca\u201c\u66f4\u6539\u201d\u6309\u9215\u76f4\u63a5\u9032\u5165\u8a72\u7af8\u9078\u9805\u76ee\u3002",
                    ly: "\u5982\u4f55\u9032\u884c\u81ea\u586b\u9078\u9805\uff1f",
                    lz: "\u55ae\u64ca\u6216\u9ede\u9078\u5019\u9078\u4eba\u5e95\u90e8\u5217\u8868\u7684\u201c\u81ea\u586b\u5beb\u5019\u9078\u4eba\u201d\u3002\u4e92\u52d5\u5f0f\u6a23\u672c\u9078\u7968\u4e0d\u5141\u8a31\u60a8\u8f38\u5165\u81ea\u5861\u4faf\u9078\u4eba\u7684\u4fe1\u606f\uff0c\u800c\u662f\u5728\u6295\u7968\u4e2d\u5fc3\u6295\u7968\u6642\uff0c\u6295\u7968\u6a19\u8a18\u8a2d\u5099\u5c07\u63d0\u793a\u60a8\u8f38\u5165\u81ea\u5861\u4faf\u9078\u4eba\u7684\u4fe1\u606f\u3002",
                    qa: "\u5982\u4f55\u53d6\u6d88\u5019\u9078\u4eba\u9078\u9805\uff1f",
                    qb: "\u901a\u904e\u55ae\u64ca\u6216\u9ede\u6309\u9078\u64c7\u7684\u9078\u9805\u4f86\u53d6\u6d88\u5019\u9078\u4eba\u9078\u9805\uff0c\u60a8\u7684\u9078\u64c7\u5c07\u88ab\u53d6\u6d88\u3002",
                    qc: "\u4ec0\u9ebc\u662f\u8a55\u8ad6\u9801\u9762\uff1f",
                    qd: "\u901a\u904e\u201c\u9801\u9762\u67e5\u770b\u201d\uff0c\u60a8\u53ef\u4ee5\u5728\u7522\u751f\u6295\u7968\u901a\u884c\u8b49 (Poll Pass) \u4e4b\u524d\u9a57\u8b49\u6216\u9032\u884c\u66f4\u6539\u3002\u9032\u5165\u6295\u7968\u4e2d\u5fc3\u5f8c\uff0c\u60a8\u5c07\u6709\u53e6\u4e00\u500b\u6a5f\u6703\u4f86\u66f4\u65b0\u60a8\u7684\u9078\u9805\u3002",
                    qe: "\u4ec0\u9ebc\u662f\u6295\u7968\u901a\u884c\u8b49 (Poll Pass)\uff1f",
                    qf: "\u6295\u7968\u901a\u884c\u8b49  (Poll Pass) \u662f\u5305\u542b\u60a8\u7684\u9078\u64c7\u7522\u751f\u7684\u4e8c\u7dad\u78bc (QR Code)\u3002\u6295\u7968\u4e2d\u5fc3\u7684\u6295\u7968\u6a19\u8a18\u8a2d\u5099\u6703\u6383\u63cf\u6b64\u4e8c\u7dad\u78bc(QR Code)\uff0c\u4e26\u5c07\u60a8\u7684\u9078\u64c7\u8f49\u79fb\u5230\u60a8\u7684\u6b63\u5f0f\u6295\u7968\u4e2d\u3002\u90a3\u6642\uff0c\u60a8\u53ef\u4ee5\u5728\u6295\u7968\u524d\u67e5\u770b\u548c/\u6216\u66f4\u6539\u5b98\u65b9\u9078\u7968\u4e0a\u7684\u6240\u6709\u9078\u64c7\u3002",
                    qg: "\u6211\u7684\u6295\u7968\u901a\u884c\u8b49 (Poll Pass) \u901a\u904e\u4e86\u55ce\uff1f",
                    qh: "\u4e0d\u6703\u3002\u6295\u7968\u901a\u884c\u8b49 (Poll Pass) \u4e0d\u662f\u60a8\u7684\u6b63\u5f0f\u6295\u7968\uff0c\u4e5f\u4e0d\u7b97\u4f5c\u60a8\u7684\u6295\u7968\u3002\u6295\u7968\u901a\u884c\u8b49 (Poll Pass) \u662f\u4e00\u7a2e\u5de5\u5177\uff0c\u53ef\u901a\u904e\u63d0\u524d\u6e96\u5099\u60a8\u7684\u9078\u64c7\u4f86\u5e6b\u52a9\u52a0\u5feb\u6295\u7968\u6d41\u7a0b\uff0c\u56e0\u6b64\u53ef\u4ee5\u5c07\u5176\u8f49\u79fb\u5230\u6295\u7968\u4e2d\u5fc3\u7684\u6b63\u5f0f\u9078\u7968\u4e2d\u3002",
                    qi: "\u6211\u53ef\u4ee5\u4f7f\u7528\u4e92\u52d5\u5f0f\u9078\u7968\u6a23\u672c\u591a\u5c11\u6b21\uff1f",
                    qj: "\u53ef\u4ee5\u4f7f\u7528\u4e92\u52d5\u5f0f\u9078\u7968\u6a23\u672c\u7684\u6b21\u6578\u6c92\u6709\u9650\u5236\uff0c\u4f46\u662f\u53ea\u6709\u4e00\u5f35\u6295\u7968\u901a\u884c\u8b49 (Poll Pass) \u5c07\u88ab\u8f49\u79fb\u5230\u6295\u7968\u6a19\u8a18\u8a2d\u5099\u4e2d\u9032\u884c\u6b63\u5f0f\u6295\u7968\u3002",
                    qk: "\u6211\u7684\u500b\u4eba\u4fe1\u606f\u662f\u5426\u5305\u542b\u5728\u6295\u7968\u901a\u884c\u8b49\u4e2d\uff1f",
