                    lb: "\xbfPor qu\xe9 no se encuentran resultados despu\xe9s de ingresar mi informaci\xf3n y/o direcci\xf3n?",
                    lc: "Es posible que no est\xe9 registrado para votar en el Condado de Los Angeles, o la informaci\xf3n que ingres\xf3 no coincide con su registro de elector actual. Adem\xe1s, si ingresa una direcci\xf3n fuera del Condado de Los Angeles, no se encontrar\xe1n resultados. Si usted cree que esto es un error por favor cont\xe1ctenos a voterinfo@rrcc.lacounty.gov o al 1-800-815-2666 opci\xf3n 2. <a href='https://www.lavote.net/home/voting-elections/voter-education/what-to-do-before-an-election/register-to-vote' target='_blank'>Si no est\xe1 registrado para votar, usted puede registrarse aqu\xed.</a>",
                    ld: "\xbfSe registrar\xe1, almacenar\xe1 o documentar\xe1 mi informaci\xf3n?",
