                    ls: "\xbfC\xf3mo selecciono mi voto?",
                    lt: "Haga clic o toque en cualquier lugar dentro del cuadro rectangular que rodea al candidato o contienda para hacer su selecci\xf3n. Si est\xe1 utilizando un dispositivo de asistencia, navegue hasta la opci\xf3n que desee y haga la selecci\xf3n una vez que est\xe9 resaltada.",
