                    lx: 'Haga clic o toque el bot\xf3n "Atr\xe1s" o "Siguiente" en la parte inferior de cada contienda. Para dispositivos de escritorio o port\xe1tiles, hay una herramienta de navegaci\xf3n de boleta electoral llamada "Mi Boleta Electoral" ubicada a la izquierda. Despl\xe1cese por "Mi Boleta Electoral" para saltar directamente a una contienda haciendo clic o tocando en su t\xedtulo. Para dispositivos m\xf3viles o de mano, puede saltar a una contienda espec\xedfica haciendo clic o tocando "Revisar" (ubicado en el encabezado). Luego, despl\xe1cese a la contienda sobre la que desea votar y toque el bot\xf3n "Cambiar" para ir directamente a esa contienda.',
