                    bx: "\u0417\u0430\u043a\u043e\u043d \u0440\u0430\u0437\u0440\u0435\u0448\u0430\u0435\u0442 \u0432\u043e\u0435\u043d\u043d\u044b\u043c \u0438 \u0438\u0437\u0431\u0438\u0440\u0430\u0442\u0435\u043b\u044f\u043c \u043d\u0430\u0445\u043e\u0434\u044f\u0449\u0438\u043c\u0441\u044f \u0437\u0430 \u0440\u0443\u0431\u0435\u0436\u043e\u043c \u043f\u043e\u043b\u0443\u0447\u0430\u0442\u044c \u0434\u043e\u0441\u0442\u0443\u043f \u043a \u0441\u0432\u043e\u0438\u043c \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044f\u043c \u0438 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u0442\u044c \u0432 \u0418\u043d\u0442\u0435\u0440\u043d\u0435\u0442\u0435.",
