                    jk: "\u0938\u0902\u0915\u0947\u0924",
                    jl: "\u0906\u092a \u0907\u0938 \u092a\u094d\u0930\u0924\u093f\u092f\u094b\u0917\u093f\u0924\u093e \u0915\u0947 \u0932\u093f\u090f \u0938\u094d\u0935\u0940\u0915\u0943\u0924 \u0905\u0927\u093f\u0915\u0924\u092e \u091a\u092f\u0928\u094b\u0902 \u0924\u0915 \u092a\u0939\u0941\u0901\u091a \u0917\u090f \u0939\u0948\u0902\u0964 \u0905\u092a\u0928\u093e \u091a\u092f\u0928 \u092c\u0926\u0932\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f, \u0906\u092a\u0915\u094b \u092a\u0939\u0932\u0947 \u0905\u092a\u0928\u0940 \u092e\u094c\u091c\u0942\u0926\u093e \u092a\u0938\u0902\u0926 \u0915\u094b \u0905\u091a\u092f\u0928\u093f\u0924 \u0915\u0930\u0928\u093e \u0939\u094b\u0917\u093e\u0964",
