                    ij: "\u0110a\u0303 Xem",
                    ik: "Bo\u0309 Qua",
                    il: "G\u01a1\u0309i la\u0323i la\u0301 phi\xea\u0301u cu\u0309a quy\u0301 vi\u0323",
                    im: "1. \u0110\u0103\u0323t la\u0301 phi\xea\u0301u \u0111\u01b0\u01a1\u0323c in ra cu\u0309a quy\u0301 vi\u0323 va\u0300o trong phong bi\u0300 g\u01a1\u0309i la\u0323i cu\u0309a quy\u0301 vi\u0323.",
                    in: "2. Ky\u0301 t\xean, ghi nga\u0300y tha\u0301ng, va\u0300 da\u0301n ki\u0301n phong bi\u0300 g\u01a1\u0309i la\u0323i cu\u0309a quy\u0301 vi\u0323.",
