                    ui: "\u0110\u1ed1i v\u1edbi cu\u1ed9c T\u1ed5ng Tuy\u1ec3n C\u1eed va\u0300o Ng\xe0y 3 Th\xe1ng M\u01b0\u01a1\u0300i M\xf4\u0323t, 2020, t\u1ea5t c\u1ea3 c\u1eed tri \u0111\xe3 ghi danh \u1edf California \u0111\u1ec1u \u0111\u1ee7 \u0111i\u1ec1u ki\u1ec7n s\u1eed d\u1ee5ng h\u1ec7 th\u1ed1ng b\xe2\u0300u b\u0103\u0300ng th\u01b0 c\xf3 th\u1ec3 truy c\u1eadp n\xe0y.",
