                    lc: "Es posible que no est\xe9 registrado para votar en el Condado de Los Angeles, o la informaci\xf3n que ingres\xf3 no coincide con su registro de elector actual. Adem\xe1s, si ingresa una direcci\xf3n fuera del Condado de Los Angeles no se encontrar\xe1n resultados. Si usted cree que esto es un error, por favor cont\xe1ctenos a voterinfo@rrcc.lacounty.gov o al 1-800-815-2666 opci\xf3n 2. <a href='https://www.lavote.net/home/voting-elections/voter-education/what-to-do-before-an-election/register-to-vote' target='_blank'>Si no est\xe1 registrado para votar, usted puede registrarse aqu\xed.</a>",
                    ld: "\xbfSe registrar\xe1, almacenar\xe1 o documentar\xe1 mi informaci\xf3n?",
                    le: "No. Su informaci\xf3n y/o direcci\xf3n solo se utilizar\xe1n para proporcionar su boleta electoral correcta.",
                    lj: "\xbfSon seguras mis selecciones?",
                    lk: "Si. Sus selecciones solo se guardan en su Pase Electoral o en su dispositivo personal.",
                    ll: "\xbfMis selecciones ser\xe1n recogidas por el Condado?",
                    lm: "No. El Condado no recoje sus selecciones en la Muestra de Boleta Electoral Interectiva. Solo se recoger\xe1n las selecciones que presente en su boleta electoral oficial en el Centro de Votaci\xf3n.",
                    ln: "\xbfSe perder\xe1n mis selecciones si cierro mi navegador web o la pesta\xf1a del navegador?",
                    lo: 'Si. Si usted est\xe1 utilizando un dispositivo p\xfablico y selecciona "Este es un dispositivo p\xfablico" en la solicitud de privacidad. Alternativamente, si est\xe1 utilizando su dispositivo personal y selecciona "Este es un dispositivo privado" en la solicitud de privacidad, sus selecciones se guardar\xe1n hasta que se borre la memoria cach\xe9 del navegador.',
                    lq: "\xbfQu\xe9 sucede si deseo cambiar mis configuraciones de privacidad despu\xe9s de comenzar a marcar?",
                    lr: 'La configuraci\xf3n de privacidad se puede cambiar en cualquier momento navegando el men\xfa de privacidad ubicado en el men\xfa de Configuraciones. Tambi\xe9n puede cambiar esta configuraci\xf3n desde la P\xe1gina Revisar seleccionando el bot\xf3n "Guardar Selecciones para m\xe1s Tarde" en el pie de la p\xe1gina inferior.',
                    ls: "\xbfC\xf3mo selecciono mi voto?",
                    lt: "Haga clic o toque en cualquier lugar dentro del cuadro rectangular que rodea al candidato o contienda para hacer su selecci\xf3n. Si est\xe1 utilizando un dispositivo de asistencia, navegue a la opci\xf3n que desee y haga la selecci\xf3n una vez que est\xe9 resaltada.",
                    lu: "\xbfC\xf3mo aprendo m\xe1s sobre un candidato o iniciativa de ley/propuesta?",
                    lv: 'Haga clic o toque el icono de Informaci\xf3n a la derecha del candidato o iniciativa de ley/propuesta. Cuando termine de revisar la informaci\xf3n adicional, haga clic o toque "Cerrar" para volver a la contienda.',
                    lw: "\xbfC\xf3mo navego por la boleta electoral?",
                    lx: 'Haga clic o toque el bot\xf3n "Atr\xe1s" o "Siguiente" en la parte inferior de cada contienda. Para dispositivos de escritorio o port\xe1tiles, hay una herramienta de navegaci\xf3n de boleta electoral llamada "Mi Boleta Electoral" ubicada a la izquierda. Despl\xe1cese por "Mi Boleta Electoral" para saltar directamente a una contienda haciendo clic o tocando en su t\xedtulo. Para dispositivos m\xf3viles o de mano, puede saltar a una contienda espec\xedfica haciendo clic o tocando "Revisar" (ubicado en el encabezado). Luego, despl\xe1cese a la contienda sobre la que desea votar y toque el bot\xf3n "Cambiar" para ir directamente a esa contienda.',
                    ly: "\xbfC\xf3mo hago una selecci\xf3n por-escrito?",
                    lz: "Haga clic o toque \u201cCandidato por Escrito\u201d ubicado en la parte inferior de la lista de candidatos. La Muestra de Boleta Electoral Interectiva no le permite escribir la informaci\xf3n para el candidato por escrito, en cambio, cuando vote en el Centro de Votaci\xf3n, el Dispositivo de Marcaci\xf3n de la Boleta Electoral le pedir\xe1 que ingrese su candidato por escrito.",
                    qa: "\xbfC\xf3mo puedo deseleccionar a un candidato?",
                    qb: "Deseleccione un candidato haciendo clic o tocando la opci\xf3n seleccionada y su selecci\xf3n ser\xe1 deseleccionada.",
                    qc: "\xbfQu\xe9 es la P\xe1gina de Revisi\xf3n?",
