                    rf: "<a href='https://lavote.net/\u0627\u0637\u0644\u0627\u0639\u0627\u062a-\u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a-\u0627\u0636\u0627\u0641\u06cc' target='_blank'>\u0628\u0631\u0627\u06cc \u0645\u0634\u0627\u0647\u062f\u0647 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u0645\u0631\u0628\u0648\u0637 \u0628\u0647 \u0627\u0645\u0648\u0631 \u0645\u0627\u0644\u06cc \u0645\u0628\u0627\u0631\u0632\u0647 \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a\u06cc \u0648 \u0627\u0637\u0644\u0627\u0639\u0627\u062a \u062a\u0623\u06cc\u06cc\u062f \u062d\u0632\u0628\u06cc \u0644\u0637\u0641\u0627\u064b \u0627\u06cc\u0646\u062c\u0627 \u0631\u0627 \u06a9\u0644\u06cc\u06a9 \u06a9\u0646\u06cc\u062f</a> ",
                    ui: "\u0628\u0631\u0627\u06cc \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a \u0639\u0645\u0648\u0645\u06cc 3 \u0646\u0648\u0627\u0645\u0628\u0631\u060c 2020\u060c \u0647\u0645\u0647 \u0631\u0627\u06cc \u062f\u0647\u0646\u062f\u06af\u0627\u0646 \u062b\u0628\u062a \u0646\u0627\u0645 \u0634\u062f\u0647 \u062f\u0631 California \u0648\u0627\u062c\u062f \u0634\u0631\u0627\u06cc\u0637 \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0633\u06cc\u0633\u062a\u0645 \u0642\u0627\u0628\u0644 \u062f\u0633\u062a\u0631\u0633 \u0631\u0623\u06cc \u067e\u0633\u062a\u06cc \u0647\u0633\u062a\u0646\u062f.",
                    uia: "\u0645\u0646 \u06cc\u06a9 \u0631\u0623\u06cc \u062f\u0647\u0646\u062f\u0647 \u062b\u0628\u062a \u0634\u062f\u0647 \u062f\u0631 California \u0647\u0633\u062a\u0645\u060c \u0628\u0646\u0627\u0628\u0631\u0627\u06cc\u0646 \u0648\u0627\u062c\u062f \u0634\u0631\u0627\u06cc\u0637 \u0645\u06cc \u0628\u0627\u0634\u0645 \u06a9\u0647 \u0627\u0632 \u0627\u06cc\u0646 \u0633\u06cc\u0633\u062a\u0645 \u0642\u0627\u0628\u0644 \u062f\u0633\u062a\u0631\u0633 \u0631\u0623\u06cc \u067e\u0633\u062a\u06cc \u0627\u0633\u062a\u0641\u0627\u062f\u0647 \u0646\u0645\u0627\u06cc\u0645. ",
                    uib: "\u0645\u06cc \u062f\u0627\u0646\u0645 \u06a9\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0647\u0627\u06cc \u0628\u0631\u06af\u0647 \u0631\u0627\u06cc \u0645\u0646 \u06a9\u0647 \u062a\u0648\u0633\u0637 \u0627\u06cc\u0646 \u0633\u06cc\u0633\u062a\u0645 \u0639\u0644\u0627\u0645\u062a \u06af\u0630\u0627\u0631\u06cc \u0634\u062f\u0647 \u0628\u0627\u06cc\u062f \u062a\u0648\u0633\u0637 \u062e\u0648\u062f\u0645 \u067e\u0631\u06cc\u0646\u062a \u0634\u0648\u062f \u0648 \u0628\u0647 \u0645\u0642\u0627\u0645 \u0631\u0633\u0645\u06cc \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a \u0634\u0647\u0631\u0633\u062a\u0627\u0646\u060c \u0645\u062a\u0635\u062f\u06cc \u062b\u0628\u062a-\u062b\u0628\u062a \u06a9\u0646\u0646\u062f\u0647/\u0645\u0646\u0634\u06cc \u0627\u0645\u0648\u0631 \u0634\u0647\u0631\u0633\u062a\u0627\u0646 Los Angeles \u0627\u0631\u0633\u0627\u0644 \u06af\u0631\u062f\u062f.",
                    uic: "\u0645\u06cc \u062f\u0627\u0646\u0645 \u06a9\u0647 \u0628\u0627\u06cc\u062f \u0627\u0646\u062a\u062e\u0627\u0628 \u0647\u0627\u06cc \u0686\u0627\u067e \u0634\u062f\u0647 \u0648 \u0627\u0645\u0636\u0627\u0621 \u0634\u062f\u0647 \u062e\u0648\u062f \u0631\u0627 \u062a\u0627 \u062d\u062f\u0627\u06a9\u062b\u0631 8 \u0634\u0628 \u0628\u0647 \u0648\u0642\u062a \u0627\u0633\u062a\u0627\u0646\u062f\u0627\u0631\u062f \u067e\u0627\u0633\u0641\u06cc\u06a9 \u062f\u0631 3 \u0646\u0648\u0627\u0645\u0628\u0631\u060c 2020 - \u0631\u0648\u0632 \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a - \u0627\u0631\u0633\u0627\u0644 \u0646\u0645\u0627\u06cc\u0645 \u0628\u0647 \u0648\u0633\u06cc\u0644\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u0627\u06cc\u0646 \u0631\u0648\u0634 \u0647\u0627:   ",
                    uid: "\u0627\u0631\u0633\u0627\u0644 \u0622\u0646 \u0627\u0632 \u0637\u0631\u06cc\u0642 \u0633\u0631\u0648\u06cc\u0633 \u067e\u0633\u062a\u06cc \u0627\u06cc\u0627\u0644\u0627\u062a \u0645\u062a\u062d\u062f\u0647 \u0628\u0627 \u0645\u0647\u0631 \u0628\u0627\u0637\u0644\u0647 \u062a\u0645\u0628\u0631 \u067e\u0633\u062a \u062f\u0631 \u06cc\u0627 \u0642\u0628\u0644 \u0627\u0632 3 \u0646\u0648\u0627\u0645\u0628\u0631\u060c 2020\u061b \u06cc\u0627",
                    uie: "\u062a\u062d\u0648\u06cc\u0644 \u062f\u0633\u062a\u06cc \u0622\u0646 \u0628\u0647 \u062f\u0641\u062a\u0631 \u0645\u0642\u0627\u0645 \u0631\u0633\u0645\u06cc \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a \u0634\u0647\u0631\u0633\u062a\u0627\u0646 \u062e\u0648\u062f\u061b \u06cc\u0627",
                    uif: "\u062a\u062d\u0648\u06cc\u0644 \u0622\u0646 \u0628\u0647 \u06cc\u06a9\u06cc \u0627\u0632 \u0645\u062d\u0644 \u0647\u0627\u06cc \u0627\u062e\u0630 \u0631\u0623\u06cc\u060c \u0645\u0631\u06a9\u0632 \u0631\u0623\u06cc\u060c \u0645\u062d\u0644 \u062a\u062d\u0648\u06cc\u0644 \u0631\u0623\u06cc \u067e\u0633\u062a\u06cc \u06cc\u0627 \u0635\u0646\u062f\u0648\u0642 \u062a\u062d\u0648\u06cc\u0644 \u062f\u0631 \u0627\u06cc\u0627\u0644\u062a.",
                    uig: "\u0645\u06cc \u062f\u0627\u0646\u0645 \u06a9\u0647 \u0627\u0646\u062a\u062e\u0627\u0628 \u0647\u0627\u06cc \u0628\u0631\u06af\u0647 \u0631\u0627\u06cc \u0645\u0646 \u06a9\u0647 \u062a\u0648\u0633\u0637 \u0627\u06cc\u0646 \u0633\u06cc\u0633\u062a\u0645 \u0639\u0644\u0627\u0645\u062a \u06af\u0630\u0627\u0631\u06cc \u0634\u062f\u0647 \u0648 \u0628\u0647 \u0645\u062a\u0635\u062f\u06cc \u062b\u0628\u062a-\u062b\u0628\u062a \u06a9\u0646\u0646\u062f\u0647/\u0645\u0646\u0634\u06cc \u0627\u0645\u0648\u0631 \u0634\u0647\u0631\u0633\u062a\u0627\u0646 Los Angeles \u0627\u0631\u0633\u0627\u0644 \u06af\u0631\u062f\u06cc\u062f\u0647 \u062a\u0648\u0633\u0637 \u06cc\u06a9 \u0645\u0642\u0627\u0645 \u0631\u0633\u0645\u06cc \u0627\u0646\u062a\u062e\u0627\u0628\u0627\u062a \u062f\u0631 \u0628\u0631\u06af\u0647 \u0631\u0627\u06cc \u0645\u0646\u062a\u0642\u0644 \u0645\u06cc \u0634\u0648\u062f \u062a\u0627 \u062f\u0631 \u0622\u0646 \u062c\u062f\u0648\u0644 \u0628\u0646\u062f\u06cc \u0634\u0648\u062f.",
