                    zkp: "\u0e19\u0e32\u0e22\u0e17\u0e30\u0e40\u0e1a\u0e35\u0e22\u0e19-\u0e1c\u0e39\u0e49\u0e1a\u0e31\u0e19\u0e17\u0e36\u0e01/\u0e1b\u0e25\u0e31\u0e14\u0e21\u0e13\u0e11\u0e25",
                    zkq: "\u0e01\u0e32\u0e23\u0e40\u0e02\u0e49\u0e32\u0e16\u0e36\u0e07\u0e1a\u0e31\u0e15\u0e23\u0e25\u0e07\u0e04\u0e30\u0e41\u0e19\u0e19\u0e17\u0e32\u0e07\u0e44\u0e1b\u0e23\u0e29\u0e13\u0e35\u0e22\u0e4c\u0e08\u0e32\u0e01\u0e1e\u0e37\u0e49\u0e19\u0e17\u0e35\u0e48\u0e2b\u0e48\u0e32\u0e07\u0e44\u0e01\u0e25",
                    zkw: "\u0e17\u0e33\u0e2d\u0e30\u0e44\u0e23\u0e15\u0e48\u0e2d?",
