                    ga: "\u0432\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439",
                    gb: "\u0417\u0430\u043a\u043e\u043d\u0447\u0438\u0442\u044c \u0432\u043f\u0438\u0441\u0430\u043d\u043d\u044b\u0439 \u0432\u044b\u0431\u043e\u0440 \u0432 \u0446\u0435\u043d\u0442\u0440\u0435 \u0433\u043e\u043b\u043e\u0441\u043e\u0432\u0430\u043d\u0438\u044f.",
                    gc: "\u0410\u043d\u0430\u043b\u0438\u0437",
                    gd: "\u0431\u043e\u043b\u044c\u0448\u0435",
                    ge: "\u041f\u0440\u043e\u0432\u0435\u0440\u0438\u0442\u044c \u0432\u044b\u0431\u043e\u0440",
                    gf: "\u041d\u0430\u0437\u0430\u0434",
                    gg: "\u0412\u044b\u0431\u043e\u0440\u044b",
                    gh: "\u0414\u0430\u043b\u0435\u0435",
                    gi: "\u0410\u0440\u0433\u0443\u043c\u0435\u043d\u0442 \u0417\u0430",
                    gj: "\u0410\u0440\u0433\u0443\u043c\u0435\u043d\u0442 \u041f\u0440\u043e\u0442\u0438\u0432",
                    gk: "\u0417\u0430\u043a\u0440\u044b\u0442\u044c",
                    gl: "\u041f\u0440\u043e\u0432\u0435\u0440\u0438\u0442\u044c \u0432\u0430\u0448\u0438 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u0435",
                    gm: '\u0412\u044b \u043c\u043e\u0436\u0435\u0442\u0435 \u043e\u0431\u043d\u043e\u0432\u0438\u0442\u044c \u043b\u044e\u0431\u043e\u0439 \u0432\u044b\u0431\u043e\u0440, \u043d\u0430\u0436\u0430\u0432 \u043a\u043d\u043e\u043f\u043a\u0443 "\u0418\u0437\u043c\u0435\u043d\u0438\u0442\u044c".',
                    gn: '\u041a\u043e\u0433\u0434\u0430 \u0432\u044b \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u0442\u0435 \u043e\u0442\u043c\u0435\u0447\u0430\u0442\u044c \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c, \u043d\u0430\u0436\u043c\u0438\u0442\u0435 \u043a\u043d\u043e\u043f\u043a\u0443 "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u044c \u0432\u044b\u0431\u043e\u0440"',
                    go: "\u0414\u043e\u0441\u0442\u0443\u043f\u0435\u043d 1 \u0432\u044b\u0431\u043e\u0440",
                    gp: "\u0434\u043e\u0441\u0442\u0443\u043f\u0435\u043d \u0432\u044b\u0431\u043e\u0440 ",
                    gq: "\u0418\u0437\u043c\u0435\u043d\u0438\u0442\u044c",
