                    gs: "\u041e\u0447\u0438\u0441\u0442\u0438\u0442\u044c \u0432\u044b\u0431\u043e\u0440\u044b",
                    gt: "\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u043e\u0435 \u0434\u043b\u044f \u043f\u043e\u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0435\u0433\u043e \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u043e\u0432\u0430\u043d\u0438\u044f",
                    gu: "\u0412\u044b\u0431\u043e\u0440\u044b \u0437\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u044b",
                    gv: "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b",
                    gw: "\u0423\u0441\u043f\u0435\u0448\u043d\u043e",
                    gx: "\u0412\u044b \u043e\u0431\u043d\u043e\u0432\u0438\u043b\u0438 \u043d\u0430\u0441\u0442\u0440\u043e\u0439\u043a\u0438 \u043a\u043e\u043d\u0444\u0438\u0434\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0432\u0430\u0448\u0435\u0433\u043e \u0443\u0441\u0442\u0440\u043e\u0439\u0441\u0442\u0432\u0430 \u0441 \u041f\u0443\u0431\u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043d\u0430 \u041b\u0438\u0447\u043d\u044b\u0439",
                    gy: "\u0417\u0430\u043a\u0440\u044b\u0442\u044c",
                    gz: "\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0432\u0430\u0448\u0438 \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b",
                    ha: "\u0421\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0432\u0430\u0448\u0435\u0433\u043e \u0432\u044b\u0431\u043e\u0440\u0430 \u043e\u0431\u043d\u043e\u0432\u0438\u0442 \u0432\u0430\u0448 \u0432\u044b\u0431\u043e\u0440 \u043a\u043e\u043d\u0444\u0438\u0434\u0435\u043d\u0446\u0438\u0430\u043b\u044c\u043d\u043e\u0441\u0442\u0438 \u0441 \u041f\u0443\u0431\u043b\u0438\u0447\u043d\u043e\u0433\u043e \u043d\u0430 \u041b\u0438\u0447\u043d\u044b\u0439",
                    hb: "\u0427\u0442\u043e\u0431\u044b \u043f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u044c \u0441\u043e\u0445\u0440\u0430\u043d\u0435\u043d\u0438\u0435 \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0445 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u043e\u0432, \u043d\u0430\u0436\u043c\u0438\u0442\u0435 <b>\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u043e\u0435</b> \u043d\u0438\u0436\u0435.",
                    hc: "\u041e\u0442\u043c\u0435\u043d\u0438\u0442\u044c \u0438 \u0437\u0430\u043a\u0440\u044b\u0442\u044c \u043e\u043a\u043d\u043e",
                    hd: "\u0421\u043e\u0445\u0440\u0430\u043d\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b",
                    he: "\u041e\u0447\u0438\u0441\u0442\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b",
                    hf: "\u0415\u0441\u043b\u0438 \u0432\u044b \u0445\u043e\u0442\u0438\u0442\u0435 \u043e\u0447\u0438\u0441\u0442\u0438\u0442\u044c \u0441\u0432\u043e\u0438 \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b, \u043d\u0430\u0436\u043c\u0438\u0442\u0435 <b>\u041e\u0447\u0438\u0441\u0442\u0438\u0442\u044c \u0432\u044b\u0431\u0440\u0430\u043d\u043d\u044b\u0435 \u043f\u0430\u0440\u0430\u043c\u0435\u0442\u0440\u044b</b> \u043d\u0438\u0436\u0435.",
                    hg: "\u041e\u0442\u043c\u0435\u043d\u0438\u0442\u044c \u0438 \u0437\u0430\u043a\u0440\u044b\u0442\u044c \u043e\u043a\u043d\u043e",
                    hh: "\u041e\u0447\u0438\u0441\u0442\u0438\u0442\u044c \u0432\u044b\u0431\u043e\u0440\u044b",
                    hi: "\u041f\u043e\u0437\u0434\u0440\u0430\u0432\u043b\u044f\u0435\u043c, \u0432\u044b \u0437\u0430\u043a\u043e\u043d\u0447\u0438\u043b\u0438 \u043e\u0442\u043c\u0435\u0447\u0430\u0442\u044c \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c",
                    hj: "\u0427\u0442\u043e\u0431\u044b \u0440\u0430\u0441\u043f\u0435\u0447\u0430\u0442\u0430\u0442\u044c \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c, \u043d\u0430\u0436\u043c\u0438\u0442\u0435 \xab\u041f\u0440\u043e\u0434\u043e\u043b\u0436\u0438\u0442\u044c\xbb \u043d\u0438\u0436\u0435.",
                    hk: "\u041e\u0442\u043c\u0435\u0442\u044c\u0442\u0435 \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c",
                    hl: "\u0417\u0430\u0432\u0435\u0440\u0448\u0435\u043d\u043e \u043e\u043d\u043b\u0430\u0439\u043d",
                    hm: "\u0420\u0430\u0441\u043f\u0435\u0447\u0430\u0442\u0430\u0442\u044c \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c",
                    hn: "\u041e\u043d\u043b\u0430\u0439\u043d",
                    ho: "\u041f\u043e\u0434\u0442\u0432\u0435\u0440\u0434\u0438\u0442\u0435 \u0441\u0432\u043e\u0438 \u0432\u044b\u0431\u043e\u0440\u044b \u0432 \u043f\u0435\u0447\u0430\u0442\u043d\u043e\u043c \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u0435",
                    hp: "\u0412\u0435\u0440\u043d\u0443\u0442\u044c \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c",
                    hq: "\u041f\u043e \u043f\u043e\u0447\u0442\u0435 \u0438\u043b\u0438 \u043b\u0438\u0447\u043d\u043e",
