                    im: "1. \u041f\u043e\u043b\u043e\u0436\u0438\u0442\u0435 \u0440\u0430\u0441\u043f\u0435\u0447\u0430\u0442\u0430\u043d\u043d\u044b\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c \u0432 \u043a\u043e\u043d\u0432\u0435\u0440\u0442 \u0434\u043b\u044f \u0432\u043e\u0437\u0432\u0440\u0430\u0442\u0430.",
                    in: "2. \u041f\u043e\u0434\u043f\u0438\u0448\u0438\u0442\u0435, \u043f\u043e\u0441\u0442\u0430\u0432\u044c\u0442\u0435 \u0434\u0430\u0442\u0443 \u0438 \u0437\u0430\u043f\u0435\u0447\u0430\u0442\u0430\u0439\u0442\u0435 \u043a\u043e\u043d\u0432\u0435\u0440\u0442 \u0434\u043b\u044f \u0432\u043e\u0437\u0432\u0430\u0442\u0430.",
                    io: "3. \u0412\u0435\u0440\u043d\u0438\u0442\u0435 \u0441\u0432\u043e\u0439 \u0431\u044e\u043b\u043b\u0435\u0442\u0435\u043d\u044c, \u0438\u0441\u043f\u043e\u043b\u044c\u0437\u0443\u044f \u043e\u0434\u0438\u043d \u0438\u0437 \u0441\u043b\u0435\u0434\u0443\u044e\u0449\u0438\u0445 \u0432\u0430\u0440\u0438\u0430\u043d\u0442\u043e\u0432:",
