                    jl: "\u3053\u306e\u6295\u7968\u9805\u76ee\u3067\u9078\u629e\u3067\u304d\u308b\u6700\u5927\u6570\u306b\u9054\u3057\u307e\u3057\u305f\u3002\u9078\u629e\u3092\u5909\u66f4\u3059\u308b\u306b\u306f\u3001\u307e\u305a\u3001\u3042\u306a\u305f\u306e\u4eca\u306e\u9078\u629e\u80a2\u3092\u89e3\u9664\u3059\u308b\u5fc5\u8981\u304c\u3042\u308a\u307e\u3059\u3002",
                    jm: "\u9589\u3058\u308b",
