                    en: "\u0928\u0939\u0940\u0902\u0964 \u092b\u093f\u0930 \u0938\u0947 \u0916\u094b\u091c\u0947\u0902",
                    eo: "\u0939\u093e\u0901",
                    ep: "\u0906\u092a\u0915\u0947 \u092a\u093e\u0938 \u0915\u0908 \u092e\u0924\u092a\u0924\u094d\u0930 \u0939\u0948\u0902",
