                    ht: "\u0905\u092a\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u092e\u0941\u0926\u094d\u0930\u093f\u0924 \u0915\u0930\u0947\u0902 \u0914\u0930 \u0906\u0917\u0947 \u092c\u0922\u093c\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u091c\u093e\u0930\u0940 \u0930\u0916\u0947\u0902 \u092a\u0930 \u0915\u094d\u0932\u093f\u0915 \u0915\u0930\u0947\u0902\u0964 \u0906\u092a \u0905\u092a\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u0921\u093e\u0909\u0928\u0932\u094b\u0921 \u092d\u0940 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u092c\u093e\u0926 \u092e\u0947\u0902 \u092a\u094d\u0930\u093f\u0902\u091f \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f\u0964",
