                    il: "\u0905\u092a\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u0935\u093e\u092a\u0938 \u0915\u0930\u0947\u0902",
                    im: "1. \u0905\u092a\u0928\u0947 \u092e\u0941\u0926\u094d\u0930\u093f\u0924 \u092e\u0924\u092a\u0924\u094d\u0930 \u0915\u094b \u0905\u092a\u0928\u0947 \u0935\u093e\u092a\u0938\u0940 \u0932\u093f\u092b\u093e\u092b\u0947 \u092e\u0947\u0902 \u0930\u0916\u0947\u0902\u0964",
