                    kc: "\u092e\u0926\u0926",
                    kd: "\u092d\u093e\u0937\u093e\u090f\u0902",
                    ke: "\u0907\u0938 \u0909\u092e\u094d\u092e\u0940\u0926\u0935\u093e\u0930 \u0926\u094d\u0935\u093e\u0930\u093e \u0915\u094b\u0908 \u0935\u093f\u0936\u094d\u0932\u0947\u0937\u0923 \u092a\u094d\u0930\u0926\u093e\u0928 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0925\u093e\u0964",
                    jd: "\u0905\u0924\u093f\u0930\u093f\u0915\u094d\u0924 \u091c\u093e\u0928\u0915\u093e\u0930\u0940",
                    je: "\u0938\u0942\u091a\u0940 \u0915\u093e \u0905\u0902\u0924",
                    kg: "\u0930\u0926\u094d\u0926 \u0915\u0930\u0947\u0902",
                    kh: "\u091c\u093e\u0930\u0940 \u0930\u0916\u0928\u0947 \u0915\u0947 \u0932\u093f\u090f \u0915\u0943\u092a\u092f\u093e \u0905\u092a\u0928\u093e \u092e\u0924\u092a\u0924\u094d\u0930 \u092e\u0941\u0926\u094d\u0930\u093f\u0924 \u092f\u093e \u0921\u093e\u0909\u0928\u0932\u094b\u0921 \u0915\u0930\u0947\u0902\u0964",
