                    kq: "bumalik ",
                    lb: "Bakit walang resulta ang mahanap matapos kung ilagay ang aking impormasyon at/o direksyon ng tirahan?",
                    lc: "Maaaring hindi ka nakarehistro para bumoto sa County ng Los Angeles, o ang impormasyon na iyong inilagay ay hindi katugma ng iyong kasalukuyang rehistrasyon ng pagboto. Sa karagdagan, kung ang inilagay mong direksyon ng tirahan ay nasa labas ng County ng Los Angeles, walang resulta ang mahahanap. Kung sa iyong palagay ito ay mali, mangyaring makipag-ugnayan sa amin sa voterinfo@rrcc.lacounty.gov\xa0o sa 1-800-815-2666 opsyon 2. <a href='https://www.lavote.net/home/voting-elections/voter-education/what-to-do-before-an-election/register-to-vote' target='_blank'>Kung ikaw ay hindi nakarehistro upang bumoto, maaari kang magrehistro dito.</a>",
                    ld: "Ang aking impormasyon ba ay itatala, iimbakin o gagawing dokumentado?",
                    le: "Hindi. Ang iyong impormasyon at/o direksyon ng tirahan ay gagamitin lamang para bigyan ka ng tamang balota.",
                    lj: "Ligtas ba ang aking mga pinili?",
                    lk: "Oo. Ang iyong mga pinili ay naka-save lamang sa iyong Pases ng Pagboto o sa iyong personal na kagamitan.",
                    ll: "Ang aking mga pinili ba ay titipunin ng County?",
                    lm: "Hindi. Ang iyong mga pinili sa Interaktibong Halimbawang Balota ay hindi titipunin ng County. Ang iyong mga pinili lamang na isinumite sa iyong opisyal na balota sa Sentro ng Pagboto ang titipunin.",
                    ln: "Mawawala ba ang aking mga pinili kung isasarado ko ang aking web browser o browser tab?",
                    lo: 'Oo. Kung ikaw ay gumagamit ng pampublikong kagamitan at pinili mo ang "Ito ay isang pampublikong kagamitan" sa pagsenyas ng pagka-pribado. Bilang karagdagan, kung ikaw ay gumagamit ng iyong personal na kagamitan at pinili ang "Ito ay isang pribadong kagamitan" sa pagsenyas ng pagka-pribado, ang iyong mga pinili ay maii-save hanggang ang iyong browser ay linisin.',
                    lq: "Paano kung gusto kung baguhin ang aking pagtatakda ng pagka-pribado matapos akong magsimulang magmarka?",
                    lr: 'Ang mga pagtatakda ng pagka-pribado ay maaaring baguhin kahit na anong oras sa pamamagitan ng pag-navigate sa menu ng pagka-pribado na matatagpuan sa menu ng Pagtatakda. Maaari mo ring palitan ang pagtatakda mula sa Pahina ng Pagsusuri sa pamamagitan ng pagpili sa "I-save ang mga Pinili para Mamaya" na pindutan sa ilalim ng footer.',
                    ls: "Paano ko pipiliin ang aking iboboto?",
                    lt: "I-klik o tapikin saan man sa loob ng kahong parihaba na pumapalibot sa kandidato o panukala para gawin ang iyong pagpili. Kung ikaw ay gumagamit ng isang kagamitang pantulong, mag-navigate sa iyong nais piliin at gumawa ng pagpili habang ito ay naka-highlight.",
                    lu: "Paano ko malalaman ang iba pang tungkol sa kandidato o panukala/proposisyon?",
                    lv: 'I-klik o tapikin ang icon ng Impormasyon sa kanan ng kandidato o panukala/proposisyon. Kapag natapos ka sa pagsuri ng karagdagang impormasyon, i-klik o tapikin ang "Isarado" upang bumalik sa labanan.',
                    lw: "Paano ako mag-navigate sa balota?",
                    lx: 'I-klik o tapikin ang "Bumalik" o "Susunod" na pindutan sa ibaba ng bawat labanan. Para sa mga kagamitang desktop o laptop mayroong isang kagamitang navigator ang balota na tinatawag na "Aking Balota" na matatagpuan sa kaliwa. Mag-scroll sa "Aking Balota," upang lumaktaw na deretso sa isang labanan sa pamamagitan ng pag-klik at pagtapik sa titulo nito. Para sa mga mobile at nahahawakang mga kagamitan, maaaring lumaktaw sa isang partikular na labanan o tapikin ang "Suriin" (matatagpuan sa pamagat). Pagkatapos, mag-scroll sa labanan na gusto mong botohan at tapikin ang "Baguhin" na pindutan upang magtungo ng deretso sa labanang iyon.',
                    ly: "Paano ako gagawa ng isang isinusulat-lamang na pagpili?",
                    lz: 'I-klik o tapikin ang "Isinusulat-lamang na Kandidato" na matatagpuan sa ilalim ng listahan ng mga kandidato. Ang Interaktibong Halimbawang Balota ay hindi ka papayagang i-type ang impormasyon ng isinusulat-lamang na kandidato, sa halip kapag bumoto ka sa Sentro ng Pagboto ang Kagamitang Pangmarka ng Balota ay sisenyas sa iyo para ilagay ang pangalan ng isinusulat-lamang na kandidato.',
                    qa: "Paano ko aalisin sa pagkakapili ang isang kandidato?",
                    qb: "Alisin sa pagkakapili ang isang kandidato sa pamamagitan ng pag-klik o pagtapik sa piniling seleksyon at ang iyong napili ay aalisin.",
                    qc: "Ano ang Pahina ng Pagsusuri?",
                    qd: "Ang Pahina ng Pagsusuri ay nagpapahintulot sa iyo na patunayan o gumawa ng pagbabago bago gumawa ng iyong Pases sa Pagboto. Mayroon ka pang iba pang pagkakataon para baguhin ang iyong mga pinili kapag ikaw ay nasa Sentro ng Pagboto.",
                    qe: "Paano ko ibabalik ang aking inilimbag na balota?",
                    qf: "Ibalik ang iyong balota sa County sa pamamagitan ng pagkumpleto ng sumusunod na mga hakbang:<br>1. Ilagay ang iyong inilimbag na balota ng Pagboto sa Pamamagitan ng Koreo sa itinalalagang sobre ng pagbabalik.<br>2. Pirmahan, petsahan at i-selyado ang sobre ng pagbabalik.<br>3. Ibalik ang iyong sobre sa pamamagitan ng Koreo o ng-personal bago lumampas ang ika-8 ng gabi PST sa Araw ng Halalan:<br>- Ibalik sa Koreo:<br>Los Angeles County Registrar-Recorder/County Clerk<br>Vote by Mail Section<br>P.O. Box 30960<br>Los Angeles, CA 90030-0960<br>- Ibalik ng-personal:<br>Ihulog ang iyong balota sa isang kahon ng hulugan o sentro ng pagboto bago lumampas ang ika-8 ng gabi sa Araw ng Halalan.<br>Para sa isang listahan ng mga lokasyon bisitahin ang: locator.lavote.net/locations/vc o i-klik dito (link to: http://locator.lavote.net/locations/vc)",
                    qg: "Ang inilimbag ba na ito ang aking balota?",
                    qh: "Oo, matapos ibalik sa County sa tamang sobre ito ang kakatawan sa iyong boto. Ang County ay gagawing muli ang iyong mga pinili sa isang balota na mai-scan pero ang iyong mga pinili ay mananatiling pareho.",
                    qi: "Maari ba akong gumawa ng mahigit sa isang paglimbag?",
                    qj: "Oo, maaari kang maglimbag ng iyong mga pinili ng kahit ilan sa gusto mo. Maaari mong gamitin ang sistema ng maraming beses para gumawa ng maraming balota pero isa lamang na inilimbag ang maaaring ibalik sa County para sa opisyal na mga pinili.",
                    qk: "Ang aking personal na impormasyon ba ay nakalagay sa loob ng inilimbag? ",
                    ql: "Hindi, walang matutukoy na personal na impormasyon ang nakapaloob sa inilimbag na balota. Ang tanging impormasyon na nakapaloob sa inilimbag na balota ay: ang iyong piniling labanan, ang kumpirmasyon ng pagkakakilanlan sa halalan, hurisdiksyon at istilo ng balota. ",
