                    cy: "\u0554\u057e\u0565\u0561\u0569\u0565\u0580\u0569\u056b\u056f \u0563\u057f\u0576\u0565\u056c\u0578\u0582 \u0570\u0561\u0574\u0561\u0580 \u0585\u0563\u057f\u0561\u0563\u0578\u0580\u056e\u057e\u0578\u0582\u0574 \u0565\u0576 \u0571\u0565\u0580 \u0568\u0576\u057f\u0580\u0578\u0572\u0576\u0565\u0580\u056b \u0563\u0580\u0561\u0576\u0581\u0574\u0561\u0576 \u057f\u0565\u0572\u0565\u056f\u0578\u0582\u0569\u0575\u0578\u0582\u0576\u0576\u0565\u0580\u0568:",
                    cz: "\u0531\u0575\u057d \u057f\u0565\u0572\u0565\u056f\u0561\u057f\u057e\u0578\u0582\u0569\u0575\u0578\u0582\u0576\u0568 \u056f\u0561\u057a\u057e\u0561\u056e \u0579\u0567 \u0571\u0565\u0580 \u0568\u0576\u057f\u0580\u0578\u0582\u0569\u0575\u0561\u0576 \u0570\u0565\u057f:",
