                    dc: "\u0531\u0574\u056b\u057d\u0568",
                    dd: "\u0555\u0580\u0568",
                    de: "\u054f\u0561\u0580\u0565\u0569\u056b\u057e\u0568",
                    df: "\u0541\u0565\u0580 \u057f\u0561\u0576 \u0570\u0561\u0574\u0561\u0580\u0568",
                    dg: "\u0544\u0578\u0582\u057f\u0584\u0561\u0563\u0580\u0565\u0584 \u057f\u0561\u0576 \u0570\u0561\u0574\u0561\u0580\u0568 \u0578\u0580\u056b \u0570\u0561\u057d\u0581\u0565\u0576 \u0564\u0578\u0582\u0584 \u0585\u056f\u057f\u0561\u0563\u0578\u0580\u0581\u0565\u0581\u056b\u0584 \u0584\u057e\u0565\u0561\u0580\u056f\u0565\u056c\u0578\u0582 \u0570\u0561\u0574\u0561\u0580 \u0563\u0580\u0561\u0576\u0581\u057e\u0565\u056c\u056b\u057d:",
