                    jo: "\xabLOS ANGELES \u054e\u0531\u0550\u0549\u0531\u0547\u0550\u054b\u0531\u0546\u053b \u0553\u0548\u0550\u0541\u0531\u0550\u053f\u0544\u0531\u0546 \u0538\u0546\u054f\u0550\u0548\u0552\u0539\u0545\u0548\u0552\u0546\u0546\u0535\u0550\xbb",
