                    kl: "\u053f\u0561\u0580\u0578\u0572 \u0565\u0584 \u0569\u0561\u0580\u0574\u0561\u0581\u0576\u0565\u056c \u0581\u0561\u0576\u056f\u0561\u0581\u0561\u056e \u0568\u0576\u057f\u0580\u0578\u0582\u0569\u0575\u0578\u0582\u0576 \u0570\u057a\u0565\u056c\u0578\u057e <b> \u0553\u0578\u056d\u0565\u056c \u056f\u0578\u0573\u0561\u0568 </ b>:",
